import React from "react";
import Dashboard from "../components/Dashboard";

const HomePage = () => {
  return (
    <div>
      <h1>Welcome, {user?.name}</h1>
      <img src={user?.picture} alt={user?.name} />
      <button onClick={handleLogout}>Logout</button>
      <Dashboard />
    </div>
  );
};

export default HomePage;
